description:
In the music industry, things are rarely what they seem to be. Recently, we caught up with Atlantic Records own Kevin Gates on the 2014 BET Hip-Hop Awards Green Carpet. Despite many Hip-Hop sites reporting that Kevin Gates and Rich Gang's own Young Thug were beefing via social media, Kevin Gates cleared the air letting us know that Thugger is his little bro and there is no beef between the two rappers. 

Kevin Gates also spoke with us on his future. After headlining his own "By Any Means" tour, Gates is ready to hit the road again with Decatur Hip-Hop artist B.o.B starting in October. Kevin Gates also explained the true meaning behind his motto "I Don't Get Tired". Gates informed us on why his hustle differs from other artist in the music industry. When asked to explain his motto, Gates replied " It's self explanatory, I don't get tired. I don't get tired of being focused, get money, I don't get tired".

Before concluding the interview we also spoke to Kevin Gates about possibly working with fellow Louisiana Hip-Hop artist Boosie on a new project and new music in the future. Gates informed us that he is looking forward to working with Boosie again soon but their schedules haven't provided them time to work on anything new to date. Kevin Gates informed us that he has a bunch of new music ready to go so stay tuned for great things to come as the year 2014 concludes. 

The interview was conducted by HHS1987's Eldorado. The interview was shot by HHS1987's Brian Da Director. 

Watch the rest of our 2014 BET Hip Hop Awards Green Carpet interviews here http://www.youtube.com/playlist?list=PLVyEc5bwRmFwgQ6E33D5TpW7_Bdd8BLt4

